class Logout extends React.Component {

    signOut=()=> {
        var auth2 = window.gapi.auth2?.getAuthInstance();
        auth2?.signOut().then( ()=> {
          console.log('User signed out.');
          window.location="/"
        });
      }
    render(){
        return(
            <a href="#" onclick={this.signOut()}>Sign out</a>

        )
    }
}
export default Logout;
